import React, { useState } from 'react';
import Video from '../Video'
import Button from '../button'
import '../../App.css';
import home from './Home.module.css'
import Navbar from '../Navbar'
import Main from '../Main_hello'
import Music from '../Music'

// import Cards from '../Cards';
// import HeroSection from '../HeroSection';
// import Footer from '../Footer';

const Home = ()=> {
  const videoCode = '1rktA06Wl1A'
  const [musicSts, setMusicSt] = useState(null);

  const musicSt = (apple)=>{
    setMusicSt(apple)
  }

  return(
  <div className={home.wrap}>
      <Navbar className={'mainPage'}/>
      <Main></Main>
      <Video musicStart={musicSt}></Video>  
      <Music videoId={videoCode}></Music>
      {/* <Button className="position">click me</Button> */}
  </div>
);
};


export default Home;
